import React, { Component } from "react";
import "./node.css";

class Node extends Component {
  state = {
    nodeType: "normal-node",
  };

  render() {
    console.log(this.nodeType);
    return <div className={this.nodeType}></div>;
  }

  componentDidMount() {
    let nodeType = this.props.nodeType;
    this.setState({ nodeType });
    console.log(this.nodeType);
  }

  setStart() {}
}

export default Node;
